--
-- Table structure for table `email_confirmations`
--

DROP TABLE IF EXISTS `email_confirmations`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `email_confirmations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `confirmed_on` datetime DEFAULT NULL COMMENT 'The date in which the email was confirmed',
  `checksum` varchar(255) NOT NULL COMMENT 'Token used for the out going email used to confirm the email address',
  `message_count` int(11) NOT NULL DEFAULT '0' COMMENT 'The number of times a confirmation message has been sent',
  `last_sent_on` datetime DEFAULT NULL COMMENT 'The last time a confirmation email was sent to the user',
  `change_email_to` varchar(255) DEFAULT NULL COMMENT 'When a user wishes to update their email address, this field will store the future email address until it gets confirmed',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

